import React from 'react';

import { CustomButtonContainer } from './custom-button.styles.jsx';

const CustomButton = ({ 
    children, 
    isGoogleSignIn, 
    inverted, 
    ...otherProps 
}) => (
    <button 
        className={`${isGoogleSignIn ? 'google-sign-in': ''} ${
        isGoogleSignIn ? 'google-sign-in': ''
        } custom-button`} 
        {...otherProps}
    >
        {children}
    </button>
);

export default CustomButton;
